import Circles from './assets/Circles.svg';
import logo from './assets/logo.svg';
import './App.css';
import Typical from 'react-typical';

function App() {
  const txt_time = 2000;
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo "/>
        <img src={Circles} className="App-circles" alt="circles"/> 
        <Typical
        className="App-circles-text"
        steps={['Young', {txt_time}, 'Belgian', {txt_time}, 'Freelancer', {txt_time}, 'UX designer', {txt_time}, 'Self-learner', {txt_time}]}
        loop={Infinity}
        wrapper="h1"
        />
      </header>
    </div>
  );
}

export default App;
